import React from "react";
import { Link } from "react-router-dom";

const Navbar = ({ children }) => {
  return (
    <div className="Navbar">
      <div className="Logo">Logo</div>
      <div className="Login">
        <Link>
          <div>Signup</div>
        </Link>
        <Link>
          <div>Login</div>
        </Link>
      </div>
    </div>
  );
};

export default Navbar;
